Dalle Marche sono arrivati tre risultati importanti per il centrodestra: la riconferma di Ciarapica sindaco di Civitanova Marche, Pignotti sindaco di Sant'Elpidio a Mare e Giampaoli  sindaco di Corridonia.

Buon lavoro a tutti!
