A Verona, Parma, Piacenza, Cuneo, Catanzaro, Alessandria e in tante altre città vince il centrosinistra, vince il Pd. Congratulazioni alle sindache e ai sindaci eletti. Ora al lavoro per le elezioni del 2023. 
#ballottaggi 
@SenatoriPD @pdnetwork

Il risultato del #centrodestra alle amministrative ci impone sicuramente delle riflessioni, ma non si capisce tutto l’entusiasmo della #sinistra: i dati dicono che hanno perso diversi comuni. Terra chiama #Letta: dove sarebbe la vittoria? 
#Amministrative2022 
