I dati di queste elezioni ci obbligano a riportare Letta sul pianeta terra. Se il Pd è così sicuro di aver vinto queste amministrative, allora abbia il coraggio di confrontarsi subito alle elezioni politiche. #GiorgiaMeloni #Meloni 
